Map<QueryPart, QueryPart> resolveInParentGroupings(SortedSet<Id> identifiers){
    final Map<QueryPart, QueryPart> resolvedIdentifiers = new HashMap<QueryPart, QueryPart>();
    while (identifiers.size() > 0) {
        Id parent = identifiers.first();
        identifiers.remove(parent);
        if (!supportedIdentifier(parent)) {
            continue;
        }
        Exp exp = (Exp) resolvedIdentifiers.get(parent);
        if (exp == null) {
            exp = lookupExp(parent);
        }
        Member parentMember = getMemberFromExp(exp);
        if (!supportedMember(parentMember)) {
            continue;
        }
        resolvedIdentifiers.put(parent, (QueryPart) exp);
        batchResolveChildren(parent, parentMember, identifiers, resolvedIdentifiers);
    }
    return resolvedIdentifiers;
}

String generateInlineGeneric(List<String> columnNames,List<String> columnTypes,List<String[]> valueList,String fromClause,boolean cast){
    final StringBuilder buf = new StringBuilder();
    int columnCount = columnNames.size();
    assert columnTypes.size() == columnCount;
    Integer[] maxLengths = new Integer[columnCount];
    if (cast) {
        for (int i = 0; i < columnTypes.size(); i++) {
            String columnType = columnTypes.get(i);
            Datatype datatype = Datatype.valueOf(columnType);
            if (datatype == Datatype.String) {
                int maxLen = -1;
                for (String[] strings : valueList) {
                    if (strings[i] != null && strings[i].length() > maxLen) {
                        maxLen = strings[i].length();
                    }
                }
                maxLengths[i] = maxLen;
            }
        }
    }
    for (int i = 0; i < valueList.size(); i++) {
        if (i > 0) {
            buf.append(" union all ");
        }
        String[] values = valueList.get(i);
        buf.append("select ");
        for (int j = 0; j < values.length; j++) {
            String value = values[j];
            if (j > 0) {
                buf.append(", ");
            }
            final String columnType = columnTypes.get(j);
            final String columnName = columnNames.get(j);
            Datatype datatype = Datatype.valueOf(columnType);
            final Integer maxLength = maxLengths[j];
            if (maxLength != null) {
                buf.append("CAST(");
                quote(buf, value, datatype);
                buf.append(" AS VARCHAR(").append(maxLength).append("))");
            } else {
                quote(buf, value, datatype);
            }
            if (allowsAs()) {
                buf.append(" as ");
            } else {
                buf.append(' ');
            }
            quoteIdentifier(columnName, buf);
        }
        if (fromClause != null) {
            buf.append(fromClause);
        }
    }
    return buf.toString();
}

