void afterTable(String table,int tableRowCount){
    if (table == null) {
        return;
    }
    if (!infobrightLoad) {
        LOGGER.info("Table " + table + ": loaded " + tableRowCount + " rows.");
        return;
    }
    fileOutput.close();
    LOGGER.info("Infobright bulk load: Table " + table + ": loaded " + tableRowCount + " rows.");
    final String sql = "LOAD DATA INFILE '" + file.getAbsolutePath().replaceAll("\\\\", "\\\\\\\\") + "' INTO TABLE " + (schema != null ? schema + "." : "") + table + " FIELDS TERMINATED BY ',' OPTIONALLY ENCLOSED BY '\"'" + " ESCAPED BY '\\\\'";
    Statement statement = null;
    try {
        statement = connection.createStatement();
        statement.executeUpdate(sql);
    } catch (SQLException e) {
        throw new RuntimeException("Error while executing statement: " + sql, e);
    } finally {
        if (statement != null) {
            try {
                statement.close();
            } catch (SQLException e) {
            }
        }
    }
    fileOutput = new FileWriter(file);
}

