void shutDown(){
    synchronized (this) {
        if (log.isDebugEnabled())
            log.debug("++++ SockIOPool shutting down...");
        if (maintThread != null && maintThread.isRunning()) {
            stopMaintThread();
            while (maintThread.isRunning()) {
                if (log.isDebugEnabled())
                    log.debug("++++ waiting for main thread to finish run +++");
                try {
                    Thread.sleep(500);
                } catch (Exception ex) {
                }
            }
        }
        if (log.isDebugEnabled())
            log.debug("++++ closing all internal pools.");
        closePool(availPool);
        closePool(busyPool);
        availPool = null;
        busyPool = null;
        buckets = null;
        consistentBuckets = null;
        hostDeadDur = null;
        hostDead = null;
        maintThread = null;
        initialized = false;
        if (log.isDebugEnabled())
            log.debug("++++ SockIOPool finished shutting down.");
    }
}

boolean expandsBefore(RolapCalculation calc1,RolapCalculation calc2){
