long getDataTimestamp(Tile tile){
    switch(this.dataPolicy) {
        case RETURN_FIRST:
            for (MapDataStore mdb : mapDatabases) {
                if (mdb.supportsTile(tile)) {
                    return mdb.getDataTimestamp(tile);
                }
            }
            return 0;
        case RETURN_ALL:
        case DEDUPLICATE:
            long result = 0;
            for (MapDataStore mdb : mapDatabases) {
                if (mdb.supportsTile(tile)) {
                    result = Math.max(result, mdb.getDataTimestamp(tile));
                }
            }
            return result;
    }
    throw new IllegalStateException("Invalid data policy for multi map database");
}

int computeDelta(Calendar after,Calendar before){
    int hAfter = after.get(Calendar.HOUR_OF_DAY);
    int hBefore = before.get(Calendar.HOUR_OF_DAY);
    if (after.get(Calendar.DATE) > before.get(Calendar.DATE)) {
        hAfter += 24;
    }
    long result = (1000L * 60 * 60) * (hAfter - hBefore);
    result += (1000L * 60) * (after.get(Calendar.MINUTE) - before.get(Calendar.MINUTE));
    result += 1000L * (after.get(Calendar.SECOND) - before.get(Calendar.SECOND));
    result += after.get(Calendar.MILLISECOND) - before.get(Calendar.MILLISECOND);
    assert (result <= MILLIS_IN_A_DAY);
    return (int) result;
}

