boolean aggUsageMatchesHierarchyUsage(JdbcSchema.Table.Column.Usage aggUsage,HierarchyUsage hierarchyUsage,String levelColumnName){
    MondrianDef.Relation rel = hierarchyUsage.getJoinTable();
    JdbcSchema.Table.Column aggColumn = aggUsage.getColumn();
    String aggColumnName = aggColumn.column.name;
    String usagePrefix = hierarchyUsage.getUsagePrefix() == null ? "" : hierarchyUsage.getUsagePrefix();
    if (usagePrefix.length() > 0 && !usagePrefix.equals(aggColumnName.substring(0, usagePrefix.length()))) {
        throw new MondrianException("usagePrefix attribute " + usagePrefix + " was specified for " + hierarchyUsage.getHierarchyName() + ", but found agg column without prefix:  " + aggColumnName);
    }
    String aggColumnWithoutPrefix = aggColumnName.substring(usagePrefix.length());
    return aggUsage.relation.equals(rel) && aggColumnWithoutPrefix.equalsIgnoreCase(levelColumnName);
}

