    if (dimensionDefs != null) {
        int i = s.indexOf("<Dimension ", h);
        s = s.substring(0, i) + dimensionDefs + s.substring(i);
    }
    if (measureDefs != null) {
        int i = s.indexOf("<Measure", h);
        if (i < 0 || i > end) {
            i = end;
        }
        s = s.substring(0, i) + measureDefs + s.substring(i);
        if (i == end) {
            i = s.indexOf("<VirtualCubeMeasure", h);
            if (i < 0 || i > end) {
                i = end;
            }
            s = s.substring(0, i) + measureDefs + s.substring(i);
        }
    }
    if (memberDefs != null) {
        int i = s.indexOf("<CalculatedMember", h);
        if (i < 0 || i > end) {
            i = end;
        }
        s = s.substring(0, i) + memberDefs + s.substring(i);
    }
    if (namedSetDefs != null) {
        int i = s.indexOf("<NamedSet", h);
        if (i < 0 || i > end) {
            i = end;
        }
        s = s.substring(0, i) + namedSetDefs + s.substring(i);
    }
    if (defaultMeasure != null) {
        s = s.replaceFirst("(" + cubeName + ".*)defaultMeasure=\"[^\"]*\"", "$1defaultMeasure=\"" + defaultMeasure + "\"");
    }
    return s;
}

void loadDataToDataSets(GroupingSetsList groupingSetsList,RowList rows,Map<BitKey, GroupingSetsList.Cohort> groupingDataSetMap){
    int arity = groupingSetsList.getDefaultColumns().length;
    SegmentAxis[] axes = groupingSetsList.getDefaultAxes();
    int segmentLength = groupingSetsList.getDefaultSegments().size();
    final List<SqlStatement.Type> types = rows.getTypes();
    final boolean useGroupingSet = groupingSetsList.useGroupingSets();
    for (rows.first(); rows.next(); ) {
        final BitKey groupingBitKey;
        final GroupingSetsList.Cohort cohort;
        if (useGroupingSet) {
            groupingBitKey = (BitKey) rows.getObject(groupingSetsList.getGroupingBitKeyIndex());
            cohort = groupingDataSetMap.get(groupingBitKey);
        } else {
            groupingBitKey = null;
            cohort = groupingDataSetMap.get(BitKey.EMPTY);
        }
        final int[] pos = cohort.pos;
        for (int j = 0, k = 0; j < arity; j++) {
            final SqlStatement.Type type = types.get(j);
            switch(type) {
                case OBJECT:
                case STRING:
                case INT:
                case LONG:
                case DOUBLE:
                    Object o = rows.getObject(j);
                    if (useGroupingSet && (o == null || o == RolapUtil.sqlNullValue) && groupingBitKey.get(groupingSetsList.findGroupingFunctionIndex(j))) {
                        continue;
                    }
                    SegmentAxis axis = axes[j];
                    if (o == null) {
                        o = RolapUtil.sqlNullValue;
                    }
                    int offset = axis.getOffset((Comparable) o);
                    pos[k++] = offset;
                    break;
                default:
                    throw Util.unexpected(type);
            }
        }
        for (int j = 0; j < segmentLength; j++) {
            cohort.segmentDatasetList.get(j).populateFrom(pos, rows, arity + j);
        }
    }
}

