        iFirst = ((Number) first).doubleValue();
    }
    double iSecond;
    if (!(second instanceof Number)) {
        throw new InvalidArgumentException("Invalid parameter. " + "second parameter " + second + " of Mod function must be of type number");
    } else {
        iSecond = ((Number) second).doubleValue();
    }
    if (iSecond == 0) {
        throw new ArithmeticException("/ by zero");
    }
    return iFirst - iSecond * Vba.intNative(iFirst / iSecond);
