CellSet executeOlapQueryInternal(Query query,MondrianOlap4jCellSetMetaData cellSetMetaData){
    synchronized (this) {
        if (openCellSet != null) {
            final MondrianOlap4jCellSet cs = openCellSet;
            openCellSet = null;
            try {
                cs.close();
            } catch (Exception e) {
                throw olap4jConnection.helper.createException(null, "Error while closing previous CellSet", e);
            }
        }
        if (olap4jConnection.preferList) {
            query.setResultStyle(ResultStyle.LIST);
        }
        this.query = query;
        openCellSet = olap4jConnection.factory.newCellSet(this);
    }
    try {
        openCellSet.execute();
    } catch (QueryCanceledException e) {
        throw olap4jConnection.helper.createException("Query canceled", e);
    } catch (QueryTimeoutException e) {
        throw olap4jConnection.helper.createException(e.getMessage(), e);
    } catch (MondrianException e) {
        throw olap4jConnection.helper.createException("mondrian gave exception while executing query", e);
    }
    return openCellSet;
}

