        if (ccActual != null) {
            final SegmentColumn ccActualExcl = getExcludedRegion(ccToFlush.columnExpression);
            if (ccToFlush.values == null || (ccActualExcl != null && ccActualExcl.values != null && ccActualExcl.merge(ccToFlush).values == null)) {
                return false;
            }
            if (ccActual.values != null && ccActual.values.equals(ccToFlush.values)) {
