void makeLevelColumnUsage(JdbcSchema.Table.Column aggColumn,Hierarchy hierarchy,HierarchyUsage hierarchyUsage,String factColumnName,String levelColumnName,String symbolicName,boolean isCollapsed,RolapLevel rLevel,JdbcSchema.Table.Column ordinalColumn,JdbcSchema.Table.Column captionColumn,Map<String, JdbcSchema.Table.Column> properties){
    msgRecorder.pushContextName("Recognizer.makeLevelColumnUsage");
    try {
        if (aggColumn.hasUsage(JdbcSchema.UsageType.LEVEL)) {
            for (Iterator<JdbcSchema.Table.Column.Usage> uit = aggColumn.getUsages(JdbcSchema.UsageType.LEVEL); uit.hasNext(); ) {
                JdbcSchema.Table.Column.Usage aggUsage = uit.next();
                MondrianDef.Relation rel = hierarchyUsage.getJoinTable();
                if (!aggUsageMatchesHierarchyUsage(aggUsage, hierarchyUsage, levelColumnName)) {
                    String msg = mres.DoubleMatchForLevel.str(aggTable.getName(), dbFactTable.getName(), aggColumn.getName(), aggUsage.relation.toString(), aggColumn.column.name, rel.toString(), levelColumnName);
                    msgRecorder.reportError(msg);
                    returnValue = false;
                    msgRecorder.throwRTException();
                }
            }
        } else {
            JdbcSchema.Table.Column.Usage aggUsage = aggColumn.newUsage(JdbcSchema.UsageType.LEVEL);
            aggUsage.relation = hierarchyUsage.getJoinTable();
            aggUsage.joinExp = hierarchyUsage.getJoinExp();
            aggUsage.levelColumnName = levelColumnName;
            aggUsage.rightJoinConditionColumnName = levelColumnName;
            aggUsage.collapsed = isCollapsed;
            aggUsage.level = rLevel;
            aggUsage.captionColumn = captionColumn;
            aggUsage.ordinalColumn = ordinalColumn;
            aggUsage.properties = properties;
            makeLevelExtraUsages(aggUsage.captionColumn, aggUsage.ordinalColumn, aggUsage.properties);
            aggUsage.setSymbolicName(symbolicName);
            String tableAlias;
            if (aggUsage.joinExp instanceof MondrianDef.Column) {
                MondrianDef.Column mcolumn = (MondrianDef.Column) aggUsage.joinExp;
                tableAlias = mcolumn.table;
            } else {
                tableAlias = aggUsage.relation.getAlias();
            }
            RolapStar.Table factTable = star.getFactTable();
            RolapStar.Table descTable = factTable.findDescendant(tableAlias);
            if (descTable == null) {
                StringBuilder buf = new StringBuilder(256);
                buf.append("descendant table is null for factTable=");
                buf.append(factTable.getAlias());
                buf.append(", tableAlias=");
                buf.append(tableAlias);
                msgRecorder.reportError(buf.toString());
                returnValue = false;
                msgRecorder.throwRTException();
            }
            RolapStar.Column rc = descTable.lookupColumn(factColumnName);
            if (rc == null) {
                rc = lookupInChildren(descTable, factColumnName);
            }
            if (rc == null && hierarchyUsage.getUsagePrefix() != null) {
                rc = descTable.lookupColumn(factColumnName.substring(hierarchyUsage.getUsagePrefix().length()));
            }
            if (rc == null) {
                StringBuilder buf = new StringBuilder(256);
                buf.append("Rolap.Column not found (null) for tableAlias=");
                buf.append(tableAlias);
                buf.append(", factColumnName=");
                buf.append(factColumnName);
                buf.append(", levelColumnName=");
                buf.append(levelColumnName);
                buf.append(", symbolicName=");
                buf.append(symbolicName);
                msgRecorder.reportError(buf.toString());
                returnValue = false;
                msgRecorder.throwRTException();
            } else {
                aggUsage.rColumn = rc;
            }
        }
    } finally {
        msgRecorder.popContextName();
    }
}

