MessagePacker packShort(short v){
    if (v < -(1 << 5)) {
        if (v < -(1 << 7)) {
            writeByteAndShort(INT16, v);
        } else {
            writeByteAndByte(INT8, (byte) v);
        }
    } else if (v < (1 << 7)) {
        writeByte((byte) v);
    } else {
        if (v < (1 << 8)) {
            writeByteAndByte(UINT8, (byte) v);
        } else {
            writeByteAndShort(UINT16, v);
        }
    }
    return this;
}

