void skipComment(String startDelim,String endDelim){
    int depth = 1;
    for (int x = 0; x < startDelim.length(); x++) {
        advance();
    }
    for (; ; ) {
        if (nextChar == -1) {
            return;
        } else if (checkForSymbol(endDelim)) {
            for (int x = 0; x < endDelim.length(); x++) {
                advance();
            }
            if (--depth == 0) {
                return;
            }
        } else if (allowNestedComments && checkForSymbol(startDelim)) {
            for (int x = 0; x < startDelim.length(); x++) {
                advance();
            }
            depth++;
        } else {
