int executeForChangedRowCount(String sql,Object[] bindArgs,CancellationSignal cancellationSignal){
    if (sql == null) {
        throw new IllegalArgumentException("sql must not be null.");
    }
    int changedRows = 0;
    final int cookie = mRecentOperations.beginOperation("executeForChangedRowCount", sql, bindArgs);
    try {
        final PreparedStatement statement = acquirePreparedStatement(sql);
        try {
            throwIfStatementForbidden(statement);
            bindArguments(statement, bindArgs);
            applyBlockGuardPolicy(statement);
            attachCancellationSignal(cancellationSignal);
            try {
                changedRows = nativeExecuteForChangedRowCount(mConnectionPtr, statement.mStatementPtr);
                return changedRows;
            } finally {
                detachCancellationSignal(cancellationSignal);
            }
        } finally {
            releasePreparedStatement(statement);
        }
    } catch (RuntimeException ex) {
        mRecentOperations.failOperation(cookie, ex);
        throw ex;
    } finally {
        if (mRecentOperations.endOperationDeferLog(cookie)) {
            mRecentOperations.logOperation(cookie, "changedRows=" + changedRows);
        }
    }
}

