void cursorFillWindow(Cursor cursor,int position,CursorWindow window){
    if (position < 0 || position >= cursor.getCount()) {
        return;
    }
    final int oldPos = cursor.getPosition();
    final int numColumns = cursor.getColumnCount();
    window.clear();
    window.setStartPosition(position);
    window.setNumColumns(numColumns);
    if (cursor.moveToPosition(position)) {
        rowloop: do {
            if (!window.allocRow()) {
                break;
            }
            for (int i = 0; i < numColumns; i++) {
                final int type = cursor.getType(i);
                final boolean success;
                switch(type) {
                    case Cursor.FIELD_TYPE_NULL:
                        success = window.putNull(position, i);
                        break;
                    case Cursor.FIELD_TYPE_INTEGER:
                        success = window.putLong(cursor.getLong(i), position, i);
                        break;
                    case Cursor.FIELD_TYPE_FLOAT:
                        success = window.putDouble(cursor.getDouble(i), position, i);
                        break;
                    case Cursor.FIELD_TYPE_BLOB:
                        {
                            final byte[] value = cursor.getBlob(i);
                            success = value != null ? window.putBlob(value, position, i) : window.putNull(position, i);
                            break;
                        }
                    default:
                    case Cursor.FIELD_TYPE_STRING:
                        {
                            final String value = cursor.getString(i);
                            success = value != null ? window.putString(value, position, i) : window.putNull(position, i);
                            break;
                        }
                }
                if (!success) {
                    window.freeLastRow();
                    break rowloop;
                }
            }
            position += 1;
        } while (cursor.moveToNext());
    }
    cursor.moveToPosition(oldPos);
}

