MemberCalc[] compileMembers(Exp exp0,Exp exp1,ExpCompiler compiler){
    MemberCalc[] members = new MemberCalc[2];
    if (exp0.getType() instanceof NullType) {
        members[0] = null;
    } else {
        members[0] = compiler.compileMember(exp0);
    }
    if (exp1.getType() instanceof NullType) {
        members[1] = null;
    } else {
        members[1] = compiler.compileMember(exp1);
    }
    if (members[0] == null && members[1] == null) {
        throw MondrianResource.instance().TwoNullsNotSupported.ex();
    } else if (members[0] == null) {
        Member nullMember = ((RolapMember) members[1].evaluate(null)).getHierarchy().getNullMember();
        members[0] = (MemberCalc) ConstantCalc.constantMember(nullMember);
    } else if (members[1] == null) {
        Member nullMember = ((RolapMember) members[0].evaluate(null)).getHierarchy().getNullMember();
        members[1] = (MemberCalc) ConstantCalc.constantMember(nullMember);
    }
    return members;
}

TupleList ignoreUnrelatedDimensions(TupleList tuplesForAggregation,RolapCube baseCube){
    Set<Dimension> nonJoiningDimensions = nonJoiningDimensions(baseCube, tuplesForAggregation);
    final Set<List<Member>> processedTuples = new LinkedHashSet<List<Member>>(tuplesForAggregation.size());
    for (List<Member> tuple : tuplesForAggregation) {
        List<Member> tupleCopy = tuple;
        for (int j = 0; j < tuple.size(); j++) {
            final Member member = tuple.get(j);
            if (nonJoiningDimensions.contains(member.getDimension())) {
                if (tupleCopy == tuple) {
                    tupleCopy = new ArrayList<Member>(tuple);
                }
                final Hierarchy hierarchy = member.getDimension().getHierarchy();
                if (hierarchy.hasAll()) {
                    tupleCopy.set(j, hierarchy.getAllMember());
                } else {
                    tupleCopy.set(j, hierarchy.getDefaultMember());
                }
            }
        }
        processedTuples.add(tupleCopy);
    }
    return new DelegatingTupleList(tuplesForAggregation.getArity(), new ArrayList<List<Member>>(processedTuples));
}

