long executeForLastInsertedRowId(String sql,Object[] bindArgs,CancellationSignal cancellationSignal){
    if (sql == null) {
        throw new IllegalArgumentException("sql must not be null.");
    }
    final int cookie = mRecentOperations.beginOperation("executeForLastInsertedRowId", sql, bindArgs);
    try {
        final PreparedStatement statement = acquirePreparedStatement(sql);
        try {
            throwIfStatementForbidden(statement);
            bindArguments(statement, bindArgs);
            applyBlockGuardPolicy(statement);
            attachCancellationSignal(cancellationSignal);
            try {
                return nativeExecuteForLastInsertedRowId(mConnectionPtr, statement.mStatementPtr);
            } finally {
                detachCancellationSignal(cancellationSignal);
            }
        } finally {
            releasePreparedStatement(statement);
        }
    } catch (RuntimeException ex) {
        mRecentOperations.failOperation(cookie, ex);
        throw ex;
    } finally {
        mRecentOperations.endOperation(cookie);
    }
}

MessageBuffer readPayloadAsReference(int length){
    int bufferRemaining = buffer.size() - position;
    if (bufferRemaining >= length) {
        MessageBuffer slice = buffer.slice(position, length);
        position += length;
        return slice;
    }
    MessageBuffer dst = MessageBuffer.allocate(length);
    readPayload(dst, 0, length);
    return dst;
}

void scaleTextSize(float scaleFactor,byte zoomLevel){
    if (!textScales.containsKey(zoomLevel) || scaleFactor != textScales.get(zoomLevel)) {
        for (int i = 0, n = this.rulesList.size(); i < n; ++i) {
            Rule rule = this.rulesList.get(i);
            if (rule.zoomMin <= zoomLevel && rule.zoomMax >= zoomLevel) {
                rule.scaleTextSize(scaleFactor * this.baseTextSize, zoomLevel);
            }
        }
        textScales.put(zoomLevel, scaleFactor);
    }
}

