String replace(String s,String find,String replace,StringBuilder replace,StringBuilder buf,int start,String find,String replace){
    int findLength = find.length();
    if (findLength == 0) {
        for (int j = buf.length(); j >= 0; --j) {
            buf.insert(j, replace);
        }
        return buf;
    }
    int k = buf.length();
    while (k > 0) {
        int i = buf.lastIndexOf(find, k);
        if (i < start) {
            break;
        }
        buf.replace(i, i + find.length(), replace);
        k = i - findLength;
    }
    return buf;
}

