Member getDescendant(SchemaReader schemaReader,Member member,Level targetLevel,boolean returnFirstDescendant){
    List<Member> children;
    final int targetLevelDepth = targetLevel.getDepth();
    assertPrecondition(member.getLevel().getDepth() < targetLevelDepth, "member.getLevel().getDepth() < targetLevel.getDepth()");
    for (; ; ) {
        children = schemaReader.getMemberChildren(member);
        if (children.size() == 0) {
            return targetLevel.getHierarchy().getNullMember();
        }
        final int index = returnFirstDescendant ? 0 : (children.size() - 1);
        member = children.get(index);
        if (member.getLevel().getDepth() == targetLevelDepth) {
