void loadFromSqlInserts(){
    InputStream is = getClass().getResourceAsStream("insert.sql");
    if (is == null) {
        is = new FileInputStream(new File("src/test/resources/mondrian/test/loader/insert.sql"));
    }
    if (is == null) {
        throw new Exception("Cannot find insert.sql in class path");
    }
    try {
        final InputStreamReader reader = new InputStreamReader(is);
        final BufferedReader bufferedReader = new BufferedReader(reader);
        String line;
        int lineNumber = 0;
        Util.discard(lineNumber);
        StringBuilder buf = new StringBuilder();
        String fromQuoteChar = null;
        String toQuoteChar = dialect.getQuoteIdentifierString();
        while ((line = bufferedReader.readLine()) != null) {
            ++lineNumber;
            line = line.trim();
            if (line.startsWith("#") || line.length() == 0) {
                continue;
            }
            if (fromQuoteChar == null) {
                if (line.indexOf('`') >= 0) {
                    fromQuoteChar = "`";
                } else if (line.indexOf('"') >= 0) {
                    fromQuoteChar = "\"";
                }
            }
            if (fromQuoteChar != null && !fromQuoteChar.equals(toQuoteChar)) {
                line = line.replaceAll(fromQuoteChar, toQuoteChar);
            }
            if (line.charAt(line.length() - 1) == ';') {
                buf.append(" ").append(line.substring(0, line.length() - 1));
                buf = updateSQLLineForSchema(buf);
                executeDDL(buf.toString());
                buf.setLength(0);
            } else {
                buf.append(" ").append(line.substring(0, line.length()));
            }
        }
        if (buf.length() > 0) {
            executeDDL(buf.toString());
        }
    } finally {
        if (is != null) {
            is.close();
        }
    }
}

