boolean causeGC(MemoryMonitor mm){
    final int nosOfChunks = 1000;
    long maxMemory = mm.getMaxMemory();
    long usedMemory = mm.getUsedMemory();
    long delta = (maxMemory - usedMemory) / nosOfChunks;
    if (delta == 0) {
        delta = 1024;
    } else if (delta > Integer.MAX_VALUE) {
        delta = Integer.MAX_VALUE;
    }
    final int size = 2 * nosOfChunks;
    Object[] byteArrayHolder = new Object[size];
    for (int i = 0; i < size; i++) {
        try {
            byteArrayHolder[i] = new java.lang.ref.SoftReference(new byte[(int) delta]);
        } catch (java.lang.OutOfMemoryError ex) {
            return true;
        }
    }
    for (int i = 0; i < size; i++) {
        java.lang.ref.SoftReference ref = (java.lang.ref.SoftReference) byteArrayHolder[i];
        if (ref.get() == null) {
            return true;
        }
    }
    return false;
}

