        pw.print(sqlQuery.getDialect().quoteIdentifier(rt.getAlias()));
        if (rt.getParentTable() != null) {
            while (rt.getParentTable().getParentTable() != null) {
                rt = rt.getParentTable();
                pw.println(',');
                pw.print(prefix);
                pw.print(sqlQuery.getDialect().quoteIdentifier(rt.getAlias()));
                pw.print(" AS ");
                pw.print(sqlQuery.getDialect().quoteIdentifier(rt.getAlias()));
            }
        }
    }
    pw.println();
    pw.println("WHERE ");
    k = 0;
    for (RolapStar.Table rt : collapsedColumnUsages.keySet()) {
        if (k++ > 0) {
            pw.println(" and");
        }
        RolapStar.Condition cond = rt.getJoinCondition();
        if (cond == null) {
            continue;
        }
        pw.print(prefix);
        pw.print(cond.toString(sqlQuery));
        if (rt.getParentTable() != null) {
            while (rt.getParentTable().getParentTable() != null) {
                rt = rt.getParentTable();
                cond = rt.getJoinCondition();
                pw.println(" and");
                pw.print(prefix);
                pw.print(cond.toString(sqlQuery));
            }
        }
    }
    pw.println();
    pw.println("GROUP BY ");
    k = 0;
    for (List<JdbcSchema.Table.Column.Usage> list : collapsedColumnUsages.values()) {
        for (JdbcSchema.Table.Column.Usage usage : list) {
            if (k++ > 0) {
                pw.println(",");
            }
            JdbcSchema.Table.Column c = usage.getColumn();
            JdbcSchema.Table t = c.getTable();
            String n = (usage.usagePrefix == null) ? c.getName() : usage.usagePrefix + c.getName();
            pw.print(prefix);
            pw.print(sqlQuery.getDialect().quoteIdentifier(t.getName(), n));
        }
    }
    pw.println(';');
    return sw.toString();
}

String invalid(Messages messages,JdbcValidator jdbcValidator,TreeModel treeModel,TreeModelPath tpath,Object value,MondrianGuiDef.Cube cube,MondrianGuiDef.Dimension parentDimension,MondrianGuiDef.Hierarchy parentHierarchy,MondrianGuiDef.Level parentLevel,boolean isSchemaRequired){
    String nameMustBeSet = messages.getString("schemaTreeCellRenderer.nameMustBeSet.alert", "Name must be set");
    if (!tpath.isEmpty()) {
        int pathcount = tpath.getPathCount();
        for (int i = 0; i < pathcount && (cube == null || parentDimension == null || parentHierarchy == null || parentLevel == null); i++) {
            final Object p = tpath.getPathComponent(i);
            if (p instanceof MondrianGuiDef.Cube && cube == null) {
                cube = (MondrianGuiDef.Cube) p;
            }
            if (p instanceof MondrianGuiDef.Dimension && parentDimension == null) {
                parentDimension = (MondrianGuiDef.Dimension) p;
            }
            if (p instanceof MondrianGuiDef.Hierarchy && parentHierarchy == null) {
                parentHierarchy = (MondrianGuiDef.Hierarchy) p;
            }
            if (p instanceof MondrianGuiDef.Level && parentLevel == null) {
                parentLevel = (MondrianGuiDef.Level) p;
            }
        }
    }
    if (value instanceof MondrianGuiDef.Schema) {
        if (isEmpty(((MondrianGuiDef.Schema) value).name)) {
            return nameMustBeSet;
        }
    } else if (value instanceof MondrianGuiDef.VirtualCube) {
        MondrianGuiDef.VirtualCube virtCube = (MondrianGuiDef.VirtualCube) value;
        if (isEmpty(virtCube.name)) {
            return nameMustBeSet;
        }
        if (isEmpty(virtCube.dimensions)) {
            return messages.getString("schemaTreeCellRenderer.cubeMustHaveDimensions.alert", "Cube must contain dimensions");
        }
        if (isEmpty(virtCube.measures)) {
            return messages.getString("schemaTreeCellRenderer.cubeMustHaveMeasures.alert", "Cube must contain measures");
        }
    } else if (value instanceof MondrianGuiDef.VirtualCubeDimension) {
        if (isEmpty(((MondrianGuiDef.VirtualCubeDimension) value).name)) {
            return nameMustBeSet;
        }
    } else if (value instanceof MondrianGuiDef.VirtualCubeMeasure) {
        if (isEmpty(((MondrianGuiDef.VirtualCubeMeasure) value).name)) {
            return nameMustBeSet;
        }
    } else if (value instanceof MondrianGuiDef.Cube) {
        MondrianGuiDef.Cube cubeVal = (MondrianGuiDef.Cube) value;
        if (isEmpty(cubeVal.name)) {
            return nameMustBeSet;
        }
        if (cubeVal.fact == null || ((cubeVal.fact instanceof MondrianGuiDef.Table) && isEmpty(((MondrianGuiDef.Table) cubeVal.fact).name)) || ((cubeVal.fact instanceof MondrianGuiDef.View) && isEmpty(((MondrianGuiDef.View) cubeVal.fact).alias))) {
            return messages.getString("schemaTreeCellRenderer.factNameMustBeSet.alert", "Fact name must be set");
        }
        if (isEmpty(cubeVal.dimensions)) {
            return messages.getString("schemaTreeCellRenderer.cubeMustHaveDimensions.alert", "Cube must contain dimensions");
        }
        if (isEmpty(cubeVal.measures)) {
            return messages.getString("schemaTreeCellRenderer.cubeMustHaveMeasures.alert", "Cube must contain measures");
        }
        if (jdbcValidator.isInitialized()) {
            if (((MondrianGuiDef.Cube) value).fact instanceof MondrianGuiDef.Table) {
                final MondrianGuiDef.Table table = (MondrianGuiDef.Table) cubeVal.fact;
                String schemaName = table.schema;
                String factTable = table.name;
                if (!jdbcValidator.isTableExists(schemaName, factTable)) {
                    return messages.getFormattedString("schemaTreeCellRenderer.factTableDoesNotExist.alert", "Fact table {0} does not exist in database {1}", factTable, ((schemaName == null || schemaName.equals("")) ? "." : "schema " + schemaName));
                }
            }
        }
    } else {
        if (value instanceof MondrianGuiDef.CubeDimension) {
            if (isEmpty(((MondrianGuiDef.CubeDimension) value).name)) {
                return nameMustBeSet;
            }
            if (value instanceof MondrianGuiDef.DimensionUsage) {
                if (isEmpty(((MondrianGuiDef.DimensionUsage) value).source)) {
                    return messages.getString("schemaTreeCellRenderer.sourceMustBeSet.alert", "Source must be set");
                }
                MondrianGuiDef.Schema s = (MondrianGuiDef.Schema) treeModel.getRoot();
                MondrianGuiDef.Dimension[] ds = s.dimensions;
                String sourcename = ((MondrianGuiDef.DimensionUsage) value).source;
                boolean notfound = true;
                for (int j = 0; j < ds.length; j++) {
                    if (ds[j].name.equalsIgnoreCase(sourcename)) {
                        notfound = false;
                        break;
                    }
                }
                if (notfound) {
                    return messages.getFormattedString("schemaTreeCellRenderer.sourceInSharedDimensionDoesNotExist.alert", "Source {0} does not exist as Shared Dimension of Schema", sourcename);
                }
            }
            if (value instanceof MondrianGuiDef.Dimension && cube != null) {
                if (!isEmpty(((MondrianGuiDef.Dimension) value).foreignKey)) {
                    if (jdbcValidator.isInitialized()) {
                        if (cube.fact instanceof MondrianGuiDef.Table) {
                            final MondrianGuiDef.Table factTable = (MondrianGuiDef.Table) cube.fact;
                            String foreignKey = ((MondrianGuiDef.Dimension) value).foreignKey;
                            if (!jdbcValidator.isColExists(factTable.schema, factTable.name, foreignKey)) {
                                return messages.getFormattedString("schemaTreeCellRenderer.foreignKeyDoesNotExist.alert", "foreignKey {0} does not exist in fact table", foreignKey);
                            }
                        }
                    }
                }
            }
        } else if (value instanceof MondrianGuiDef.Level) {
            MondrianGuiDef.Level level = (MondrianGuiDef.Level) value;
            if (!isEmpty(level.levelType)) {
                if (parentDimension != null) {
                    if ((isEmpty(parentDimension.type) || parentDimension.type.equals("StandardDimension")) && !isEmpty(level.levelType) && (!level.levelType.equals(MondrianGuiDef.Level._levelType_values[0]))) {
                        return messages.getFormattedString("schemaTreeCellRenderer.levelUsedOnlyInTimeDimension.alert", "levelType {0} can only be used with a TimeDimension", level.levelType);
                    } else if (!isEmpty(parentDimension.type) && (parentDimension.type.equals("TimeDimension")) && !isEmpty(level.levelType) && (level.levelType.equals(MondrianGuiDef.Level._levelType_values[0]))) {
                        return messages.getFormattedString("schemaTreeCellRenderer.levelUsedOnlyInStandardDimension.alert", "levelType {0} can only be used with a StandardDimension", level.levelType);
                    }
                }
            }
            if (isEmpty(level.name)) {
                return messages.getString("schemaTreeCellRenderer.nameMustBeSet.alert", "Level name must be set");
            }
            String column = level.column;
            if (isEmpty(column)) {
                if (level.properties == null || level.properties.length == 0) {
                    return messages.getString("schemaTreeCellRenderer.columnMustBeSet.alert", "Column must be set");
                }
            } else {
                String theMessage = null;
                try {
                    for (int i = 0; i < DEF_LEVEL.length; i++) {
                        Field theField = level.getClass().getDeclaredField(DEF_LEVEL[i]);
                        column = (String) theField.get(level);
                        theMessage = validateColumn(column, DEF_LEVEL[i], messages, level, jdbcValidator, cube, parentHierarchy);
                        if (theMessage != null) {
                            break;
                        }
                    }
                } catch (Exception ex) {
                    LOGGER.error("ValidationUtils", ex);
                }
                return theMessage;
            }
        } else if (value instanceof MondrianGuiDef.Property) {
            MondrianGuiDef.Property p = (MondrianGuiDef.Property) value;
            String column = p.column;
            if (isEmpty(column)) {
                return messages.getString("schemaTreeCellRenderer.columnMustBeSet.alert", "Column must be set");
            }
            if (jdbcValidator.isInitialized()) {
                String table = null;
                if (parentLevel != null) {
                    table = parentLevel.table;
                }
                if (isEmpty(table)) {
                    if (parentHierarchy != null) {
                        if (parentHierarchy.relation == null && cube != null) {
                            final MondrianGuiDef.Table factTable = (MondrianGuiDef.Table) cube.fact;
                            if (!jdbcValidator.isColExists(factTable.schema, factTable.name, column)) {
                                return messages.getFormattedString("schemaTreeCellRenderer.degenDimensionColumnDoesNotExist.alert", "Degenerate dimension validation check - Column {0} does not exist in fact table", column);
                            }
                        } else if (parentHierarchy.relation instanceof MondrianGuiDef.Table) {
                            final MondrianGuiDef.Table parentTable = (MondrianGuiDef.Table) parentHierarchy.relation;
                            if (!jdbcValidator.isColExists(parentTable.schema, parentTable.name, column)) {
                                return messages.getFormattedString("schemaTreeCellRenderer.columnInDimensionDoesNotExist.alert", "Column {0} does not exist in Dimension table", parentTable.name);
                            }
                        }
                    }
                } else {
                    if (!jdbcValidator.isColExists(null, table, column)) {
                        return messages.getFormattedString("schemaTreeCellRenderer.columnInDimensionDoesNotExist.alert", "Column {0} does not exist in Level table {1}", column, table);
                    }
                }
            }
        } else if (value instanceof MondrianGuiDef.Measure) {
            final MondrianGuiDef.Measure measure = (MondrianGuiDef.Measure) value;
            if (isEmpty(measure.name)) {
                return nameMustBeSet;
            }
            if (isEmpty(measure.aggregator)) {
                return messages.getString("schemaTreeCellRenderer.aggregatorMustBeSet.alert", "Aggregator must be set");
            }
            if (measure.measureExp != null) {
            } else if (isEmpty(measure.column)) {
                return messages.getString("schemaTreeCellRenderer.columnMustBeSet.alert", "Column must be set");
            } else if (cube != null && cube.fact != null) {
                if (cube.fact instanceof MondrianGuiDef.Table) {
                    final MondrianGuiDef.Table factTable = (MondrianGuiDef.Table) cube.fact;
                    if (jdbcValidator.isInitialized()) {
                        String column = measure.column;
                        if (jdbcValidator.isColExists(factTable.schema, factTable.name, column)) {
                            int colType = jdbcValidator.getColumnDataType(factTable.schema, factTable.name, measure.column);
                            int agIndex = -1;
                            if ("sum".equals(measure.aggregator) || "avg".equals(measure.aggregator)) {
                                agIndex = 0;
                            }
                            if (!(agIndex == -1 || (colType >= 2 && colType <= 8) || colType == -5 || colType == -6)) {
                                return messages.getFormattedString("schemaTreeCellRenderer.aggregatorNotValidForColumn.alert", "Aggregator {0} is not valid for the data type of the column {1}", measure.aggregator, measure.column);
                            }
                        }
                    }
                }
            }
        } else if (value instanceof MondrianGuiDef.Hierarchy) {
            final MondrianGuiDef.Hierarchy hierarchy = (MondrianGuiDef.Hierarchy) value;
            if (hierarchy.relation instanceof MondrianGuiDef.Join) {
                if (isEmpty(hierarchy.primaryKeyTable)) {
                    if (isEmpty(hierarchy.primaryKey)) {
                        return messages.getString("schemaTreeCellRenderer.primaryKeyTableAndPrimaryKeyMustBeSet.alert", "PrimaryKeyTable and PrimaryKey must be set for Join");
                    } else {
                        return messages.getString("schemaTreeCellRenderer.primaryKeyTableMustBeSet.alert", "PrimaryKeyTable must be set for Join");
                    }
                }
                if (isEmpty(hierarchy.primaryKey)) {
                    return messages.getString("schemaTreeCellRenderer.primaryKeyMustBeSet.alert", "PrimaryKey must be set for Join");
                }
            }
            MondrianGuiDef.Level[] levels = hierarchy.levels;
            if (levels == null || levels.length == 0) {
                return messages.getString("schemaTreeCellRenderer.atLeastOneLevelForHierarchy.alert", "At least one Level must be set for Hierarchy");
            }
            String schema = null;
            String pkTable = null;
            if (hierarchy.relation instanceof MondrianGuiDef.Join) {
                String[] schemaAndTable = SchemaExplorer.getTableNameForAlias(hierarchy.relation, hierarchy.primaryKeyTable);
                schema = schemaAndTable[0];
                pkTable = schemaAndTable[1];
            } else if (hierarchy.relation instanceof MondrianGuiDef.Table) {
                final MondrianGuiDef.Table table = (MondrianGuiDef.Table) hierarchy.relation;
                pkTable = table.name;
                schema = table.schema;
            }
            if (pkTable != null && !jdbcValidator.isColExists(schema, pkTable, hierarchy.primaryKey)) {
                return messages.getFormattedString("schemaTreeCellRenderer.columnInTableDoesNotExist.alert", "Column {0} defined in field {1} does not exist in table {2}", isEmpty(hierarchy.primaryKey.trim()) ? "' '" : hierarchy.primaryKey, "primaryKey", pkTable);
            }
            if (hierarchy.relation instanceof MondrianGuiDef.Table) {
                if (!isEmpty(hierarchy.primaryKeyTable)) {
                    return messages.getString("schemaTreeCellRenderer.fieldMustBeEmpty", "Table field must be empty");
                }
            }
            String primaryKeyTable = hierarchy.primaryKeyTable;
            if (!isEmpty(primaryKeyTable) && (hierarchy.relation instanceof MondrianGuiDef.Join)) {
                TreeSet<String> joinTables = new TreeSet<String>();
                SchemaExplorer.getTableNamesForJoin(hierarchy.relation, joinTables);
                if (!joinTables.contains(primaryKeyTable)) {
                    return messages.getString("schemaTreeCellRenderer.wrongTableValue", "Table value does not correspond to any join");
                }
            }
            if (!isEmpty(primaryKeyTable) && (hierarchy.relation instanceof MondrianGuiDef.Table)) {
                MondrianGuiDef.Table theTable = (MondrianGuiDef.Table) hierarchy.relation;
                String compareTo = (theTable.alias != null && theTable.alias.trim().length() > 0) ? theTable.alias : theTable.name;
                if (!primaryKeyTable.equals(compareTo)) {
                    return messages.getString("schemaTreeCellRenderer.tableDoesNotMatch", "Table value does not correspond to Hierarchy Relation");
                }
            }
        } else if (value instanceof MondrianGuiDef.NamedSet) {
            final MondrianGuiDef.NamedSet namedSet = (MondrianGuiDef.NamedSet) value;
            if (isEmpty(namedSet.name)) {
                return nameMustBeSet;
            }
            if (isEmpty(namedSet.formula) && namedSet.formulaElement == null) {
                return messages.getString("schemaTreeCellRenderer.formulaMustBeSet.alert", "Formula must be set");
            }
        } else if (value instanceof MondrianGuiDef.Formula) {
            final MondrianGuiDef.Formula formula = (MondrianGuiDef.Formula) value;
            if (isEmpty(formula.cdata)) {
                return messages.getString("schemaTreeCellRenderer.formulaMustBeSet.alert", "Formula must be set");
            }
        } else if (value instanceof MondrianGuiDef.UserDefinedFunction) {
            final MondrianGuiDef.UserDefinedFunction udf = (MondrianGuiDef.UserDefinedFunction) value;
            if (isEmpty(udf.name)) {
                return nameMustBeSet;
            }
            if (isEmpty(udf.className) && udf.script == null) {
                return messages.getString("Either a Class Name or a Script are required", "Class name must be set");
            }
        } else if (value instanceof MondrianGuiDef.MemberFormatter) {
            final MondrianGuiDef.MemberFormatter f = (MondrianGuiDef.MemberFormatter) value;
            if (isEmpty(f.className) && f.script == null) {
                return messages.getString("schemaTreeCellRenderer.classNameOrScriptRequired.alert", "Either a Class Name or a Script are required");
            }
        } else if (value instanceof MondrianGuiDef.CellFormatter) {
            final MondrianGuiDef.CellFormatter f = (MondrianGuiDef.CellFormatter) value;
            if (isEmpty(f.className) && f.script == null) {
                return messages.getString("schemaTreeCellRenderer.classNameOrScriptRequired.alert", "Either a Class Name or a Script are required");
            }
        } else if (value instanceof MondrianGuiDef.PropertyFormatter) {
            final MondrianGuiDef.PropertyFormatter f = (MondrianGuiDef.PropertyFormatter) value;
            if (isEmpty(f.className) && f.script == null) {
                return messages.getString("schemaTreeCellRenderer.classNameOrScriptRequired.alert", "Either a Class Name or a Script are required");
            }
        } else if (value instanceof MondrianGuiDef.CalculatedMember) {
            final MondrianGuiDef.CalculatedMember calculatedMember = (MondrianGuiDef.CalculatedMember) value;
            if (isEmpty(calculatedMember.name)) {
                return nameMustBeSet;
            }
            if (isEmpty(calculatedMember.dimension)) {
                return messages.getString("schemaTreeCellRenderer.dimensionMustBeSet.alert", "Dimension must be set");
            }
            if (isEmpty(calculatedMember.formula) && calculatedMember.formulaElement == null) {
                return messages.getString("schemaTreeCellRenderer.formulaMustBeSet.alert", "Formula must be set");
            }
        } else if (value instanceof MondrianGuiDef.Join) {
            final MondrianGuiDef.Join join = (MondrianGuiDef.Join) value;
            if (isEmpty(join.leftKey)) {
                return messages.getString("schemaTreeCellRenderer.leftKeyMustBeSet.alert", "Left key must be set");
            }
            if (isEmpty(join.rightKey)) {
                return messages.getString("schemaTreeCellRenderer.rightKeyMustBeSet.alert", "Right key must be set");
            }
        } else if (value instanceof MondrianGuiDef.Table) {
            final MondrianGuiDef.Table table = (MondrianGuiDef.Table) value;
            String tableName = table.name;
            if (!jdbcValidator.isTableExists(null, tableName)) {
                return messages.getFormattedString("schemaTreeCellRenderer.tableDoesNotExist.alert", "Table {0} does not exist in database", tableName);
            }
            String theSchema = table.schema;
            if (!isEmpty(theSchema) && !jdbcValidator.isSchemaExists(theSchema)) {
                return messages.getFormattedString("schemaTreeCellRenderer.schemaDoesNotExist.alert", "Schema {0} does not exist", theSchema);
            }
            if (isEmpty(theSchema) && isSchemaRequired) {
                return messages.getString("schemaTreeCellRenderer.schemaMustBeSet.alert", "Schema must be set");
            }
        }
    }
    int childCnt = treeModel.getChildCount(value);
    for (int i = 0; i < childCnt; i++) {
        Object child = treeModel.getChild(value, i);
        String childErrMsg;
        if (child instanceof MondrianGuiDef.Cube) {
            childErrMsg = invalid(messages, jdbcValidator, treeModel, tpath, child, (MondrianGuiDef.Cube) child, parentDimension, parentHierarchy, parentLevel, isSchemaRequired);
        } else if (child instanceof MondrianGuiDef.Dimension) {
            childErrMsg = invalid(messages, jdbcValidator, treeModel, tpath, child, cube, (MondrianGuiDef.Dimension) child, parentHierarchy, parentLevel, isSchemaRequired);
        } else if (child instanceof MondrianGuiDef.Hierarchy) {
            if (value instanceof MondrianGuiDef.Dimension && cube != null && ((MondrianGuiDef.Hierarchy) child).relation != null) {
                if (isEmpty(((MondrianGuiDef.Dimension) value).foreignKey)) {
                    return messages.getString("schemaTreeCellRenderer.foreignKeyMustBeSet.alert", "Foreign key must be set");
                }
            }
            childErrMsg = invalid(messages, jdbcValidator, treeModel, tpath, child, cube, parentDimension, (MondrianGuiDef.Hierarchy) child, parentLevel, isSchemaRequired);
        } else if (child instanceof MondrianGuiDef.Level) {
            childErrMsg = invalid(messages, jdbcValidator, treeModel, tpath, child, cube, parentDimension, parentHierarchy, (MondrianGuiDef.Level) child, isSchemaRequired);
        } else {
            childErrMsg = invalid(messages, jdbcValidator, treeModel, tpath, child, cube, parentDimension, parentHierarchy, parentLevel, isSchemaRequired);
        }
        if (childErrMsg != null) {
            String childClassName = child.getClass().getName();
            String[] simpleName = childClassName.split("[$.]", 0);
            String childName;
            try {
                Field f = child.getClass().getField("name");
                childName = (String) f.get(child);
                if (childName == null) {
                    childName = "";
                }
                childErrMsg = messages.getFormattedString("schemaTreeCellRenderer.childErrorMessageWithName.alert", "{0} {1} is invalid", simpleName[simpleName.length - 1], childName);
            } catch (Exception ex) {
                childErrMsg = messages.getFormattedString("schemaTreeCellRenderer.childErrorExceptionMessage.alert", "{0} is invalid", simpleName[simpleName.length - 1]);
            }
            return childErrMsg;
        }
    }
    return null;
}

