boolean canConvert(int ordinal,Type fromType,int to,List<Resolver.Conversion> conversions){
    final int from = typeToCategory(fromType);
    if (from == to) {
        return true;
    }
    RuntimeException e = null;
    switch(from) {
        case Category.Array:
            return false;
        case Category.Dimension:
            switch(to) {
                case Category.Member:
                case Category.Tuple:
                case Category.Hierarchy:
                    conversions.add(new ConversionImpl(from, to, ordinal, 2, e));
                    return true;
                case Category.Level:
                    conversions.add(new ConversionImpl(from, to, ordinal, 3, null));
                    return true;
                default:
                    return false;
            }
        case Category.Hierarchy:
            switch(to) {
                case Category.Dimension:
                case Category.Member:
                case Category.Tuple:
                    conversions.add(new ConversionImpl(from, to, ordinal, 1, null));
                    return true;
                default:
                    return false;
            }
        case Category.Level:
            switch(to) {
                case Category.Dimension:
                    conversions.add(new ConversionImpl(from, to, ordinal, 2, null));
                    return true;
                case Category.Hierarchy:
                    conversions.add(new ConversionImpl(from, to, ordinal, 1, null));
                    return true;
                default:
                    return false;
            }
        case Category.Logical:
            switch(to) {
                case Category.Value:
                    return true;
                default:
                    return false;
            }
        case Category.Member:
            switch(to) {
                case Category.Dimension:
                case Category.Hierarchy:
                case Category.Level:
                case Category.Tuple:
                    conversions.add(new ConversionImpl(from, to, ordinal, 1, null));
                    return true;
                case Category.Set:
                    conversions.add(new ConversionImpl(from, to, ordinal, 2, null));
                    return true;
                case Category.Numeric:
                    conversions.add(new ConversionImpl(from, to, ordinal, 3, null));
                    return true;
                case Category.Value:
                case Category.String:
                    conversions.add(new ConversionImpl(from, to, ordinal, 4, null));
                    return true;
                default:
                    return false;
            }
        case Category.Numeric | Category.Constant:
            switch(to) {
                case Category.Value:
                case Category.Numeric:
                    return true;
                default:
                    return false;
            }
        case Category.Numeric:
            switch(to) {
                case Category.Logical:
                    conversions.add(new ConversionImpl(from, to, ordinal, 2, null));
                    return true;
                case Category.Value:
                case Category.Integer:
                case (Category.Integer | Category.Constant):
                case (Category.Numeric | Category.Constant):
                    return true;
                default:
                    return false;
            }
        case Category.Integer:
            switch(to) {
                case Category.Value:
                case (Category.Integer | Category.Constant):
                case Category.Numeric:
                case (Category.Numeric | Category.Constant):
                    return true;
                default:
                    return false;
            }
        case Category.Set:
            return false;
        case Category.String | Category.Constant:
            switch(to) {
                case Category.Value:
                case Category.String:
                    return true;
                default:
                    return false;
            }
        case Category.String:
            switch(to) {
                case Category.Value:
                case (Category.String | Category.Constant):
                    return true;
                default:
                    return false;
            }
        case Category.DateTime | Category.Constant:
            switch(to) {
                case Category.Value:
                case Category.DateTime:
                    return true;
                default:
                    return false;
            }
        case Category.DateTime:
            switch(to) {
                case Category.Value:
                case (Category.DateTime | Category.Constant):
                    return true;
                default:
                    return false;
            }
        case Category.Tuple:
            switch(to) {
                case Category.Set:
                    conversions.add(new ConversionImpl(from, to, ordinal, 2, null));
                    return true;
                case Category.Numeric:
                    conversions.add(new ConversionImpl(from, to, ordinal, 3, null));
                    return true;
                case Category.String:
                case Category.Value:
                    conversions.add(new ConversionImpl(from, to, ordinal, 4, null));
                    return true;
                default:
                    return false;
            }
        case Category.Value:
            switch(to) {
                case Category.String:
                case Category.Numeric:
                case Category.Logical:
                    conversions.add(new ConversionImpl(from, to, ordinal, 2, null));
                    return true;
                default:
                    return false;
            }
        case Category.Symbol:
            return false;
        case Category.Null:
            if (Category.isScalar(to)) {
                return true;
            } else if (to == Category.Member) {
                conversions.add(new ConversionImpl(from, to, ordinal, 2, null));
                return true;
            } else {
                return false;
            }
        case Category.Empty:
            return false;
        default:
            throw Util.newInternal("unknown category " + from + " for type " + fromType);
    }
}

