String trimWhitespace(String str){
    if (!hasLength(str)) {
        return str;
    }
    StringBuilder sb = new StringBuilder(str);
    while (sb.length() > 0 && Character.isWhitespace(sb.charAt(0))) {
        sb.deleteCharAt(0);
    }
    while (sb.length() > 0 && Character.isWhitespace(sb.charAt(sb.length() - 1))) {
        sb.deleteCharAt(sb.length() - 1);
    }
    return sb.toString();
}

boolean inQuote(String str,boolean nowInQuote){
    if (str.indexOf('\'') == -1) {
        return nowInQuote;
    }
    int lastPos = 0;
    while (lastPos <= str.length() && str.indexOf('\'', lastPos) != -1) {
        int pos = str.indexOf('\'', lastPos);
        nowInQuote = !nowInQuote;
        lastPos = pos + 1;
    }
    return nowInQuote;
}

String constrainLevel(RolapLevel level,SqlQuery query,RolapCube baseCube,AggStar aggStar,String columnValue,boolean caseSensitive,String constrainLevel,RolapLevel level,SqlQuery query,RolapCube baseCube,AggStar aggStar,String[] columnValue,boolean caseSensitive){
    RolapStar.Column column = null;
    if (level instanceof RolapCubeLevel) {
        column = ((RolapCubeLevel) level).getBaseStarKeyColumn(baseCube);
    }
    String columnString;
    Dialect.Datatype datatype;
    if (column != null) {
        if (column.getNameColumn() == null) {
            datatype = level.getDatatype();
        } else {
            column = column.getNameColumn();
            datatype = Dialect.Datatype.String;
        }
        if (aggStar != null) {
            int bitPos = column.getBitPosition();
            AggStar.Table.Column aggColumn = aggStar.lookupColumn(bitPos);
            if (aggColumn == null) {
                LOG.warn(mres.AggTableNoConstraintGenerated.str(aggStar.getFactTable().getName()));
                return "";
            }
            columnString = aggColumn.generateExprString(query);
        } else {
            columnString = column.generateExprString(query);
        }
    } else {
        assert (aggStar == null);
        MondrianDef.Expression exp = level.getNameExp();
        if (exp == null) {
            exp = level.getKeyExp();
            datatype = level.getDatatype();
        } else {
            datatype = Dialect.Datatype.String;
        }
        columnString = exp.getExpression(query);
    }
    String constraint;
    constraint = getColumnValueConstraint(query, columnValue, caseSensitive, columnString, datatype);
    return constraint;
}

