void readMemberChildren(List<RolapMember> members,List<RolapMember> result,MemberChildrenConstraint constraint){
    if (false) {
        Util.assertPrecondition(isSorted(members), "isSorted(members)");
    }
    List<RolapMember> children = new ConcatenableList<RolapMember>();
    source.getMemberChildren(members, children, constraint);
    Map<RolapMember, List<RolapMember>> tempMap = new HashMap<RolapMember, List<RolapMember>>();
    for (RolapMember member1 : members) {
        tempMap.put(member1, Collections.EMPTY_LIST);
    }
    for (final RolapMember child : children) {
        assert child != null : "child";
        assert tempMap != null : "tempMap";
        final RolapMember parentMember = child.getParentMember();
        List<RolapMember> list = tempMap.get(parentMember);
        if (list == null) {
            continue;
        } else if (list == Collections.EMPTY_LIST) {
            list = new ArrayList<RolapMember>();
            tempMap.put(parentMember, list);
        }
        ((List) list).add(child);
        ((List) result).add(child);
    }
    synchronized (cacheHelper) {
        for (Map.Entry<RolapMember, List<RolapMember>> entry : tempMap.entrySet()) {
            final RolapMember member = entry.getKey();
            if (cacheHelper.getChildrenFromCache(member, constraint) == null) {
                final List<RolapMember> list = entry.getValue();
                cacheHelper.putChildren(member, constraint, list);
            }
        }
    }
}

Object getExpResultCacheKey(ExpCacheDescriptor descriptor){
    final List<Object> key;
    if (nonEmpty) {
        key = new ArrayList<Object>(currentMembers.length + 1);
        key.add(descriptor.getExp());
        for (RolapMember currentMember : currentMembers) {
            key.add(currentMember);
        }
    } else {
        final int[] hierarchyOrdinals = descriptor.getDependentHierarchyOrdinals();
        key = new ArrayList<Object>(hierarchyOrdinals.length + 1);
        key.add(descriptor.getExp());
        for (final int hierarchyOrdinal : hierarchyOrdinals) {
            final Member member = currentMembers[hierarchyOrdinal];
            assert member != null;
            key.add(member);
        }
    }
    return key;
}

