Segment toSegment(SegmentHeader header,RolapStar star,BitKey constrainedColumnsBitKey,RolapStar.Column[] constrainedColumns,RolapStar.Measure measure,List<StarPredicate> compoundPredicates){
    final List<StarColumnPredicate> predicateList = new ArrayList<StarColumnPredicate>();
    for (int i = 0; i < constrainedColumns.length; i++) {
        RolapStar.Column constrainedColumn = constrainedColumns[i];
        final SortedSet<Comparable> values = header.getConstrainedColumns().get(i).values;
        StarColumnPredicate predicate;
        if (values == null) {
            predicate = new LiteralStarPredicate(constrainedColumn, true);
        } else if (values.size() == 1) {
            predicate = new ValueColumnPredicate(constrainedColumn, values.first());
        } else {
            final List<StarColumnPredicate> valuePredicateList = new ArrayList<StarColumnPredicate>();
            for (Object value : values) {
                valuePredicateList.add(new ValueColumnPredicate(constrainedColumn, value));
            }
            predicate = new ListColumnPredicate(constrainedColumn, valuePredicateList);
        }
        predicateList.add(predicate);
    }
    return new Segment(star, constrainedColumnsBitKey, constrainedColumns, measure, predicateList.toArray(new StarColumnPredicate[predicateList.size()]), new ExcludedRegionList(header), compoundPredicates);
}

