TupleList removeUnaryMembersFromTupleList(TupleList tupleList,RolapEvaluator evaluator){
    List<Member> first = null;
    boolean[] unary = null;
    for (List<Member> tuple : tupleList) {
        if (first == null) {
            first = tuple;
            unary = new boolean[tuple.size()];
            for (int i = 0; i < unary.length; i++) {
                unary[i] = true;
            }
        } else {
            for (int i = 0; i < tuple.size(); i++) {
                if (unary[i] && !tuple.get(i).equals(first.get(i))) {
                    unary[i] = false;
                }
            }
        }
    }
    int toRemove = 0;
    for (int i = 0; i < unary.length; i++) {
        if (unary[i]) {
            evaluator.setContext(first.get(i));
            toRemove++;
        }
    }
    if (toRemove > 0) {
        TupleList newList = new ListTupleList(tupleList.getArity() - toRemove, new ArrayList<Member>());
        for (List<Member> tuple : tupleList) {
            List<Member> ntuple = new ArrayList<Member>();
            for (int i = 0; i < tuple.size(); i++) {
                if (!unary[i]) {
                    ntuple.add(tuple.get(i));
                }
            }
            newList.add(ntuple);
        }
        tupleList = newList;
    }
    return tupleList;
}

