Map<List<Member>, Object> evaluateTuples(Evaluator evaluator,Calc exp,TupleList tuples){
    final int savepoint = evaluator.savepoint();
    try {
        assert exp.getType() instanceof ScalarType;
        final Map<List<Member>, Object> mapMemberToValue = new HashMap<List<Member>, Object>();
        for (int i = 0, count = tuples.size(); i < count; i++) {
            List<Member> tuple = tuples.get(i);
            evaluator.setContext(tuple);
            Object result = exp.evaluate(evaluator);
            if (result == null) {
                result = Util.nullValue;
            }
            mapMemberToValue.put(tuple, result);
        }
        return mapMemberToValue;
    } finally {
        evaluator.restore(savepoint);
    }
}

String columnValue(Column column,Object value){
    Type type = column.getType();
    String typeName = type.getName();
    if (value == null) {
        return "NULL";
    } else if ((value instanceof String) && (((String) value).length() == 0)) {
        return "NULL";
    }
    if (type == Type.Integer) {
        if (value instanceof String) {
            return (String) value;
        } else if (value instanceof Double) {
            Double result = (Double) value;
            return integerFormatter.format(result.doubleValue());
        } else if (value instanceof Integer) {
            Integer result = (Integer) value;
            return result.toString();
        }
    } else if (type == Type.Smallint) {
        if (value instanceof String) {
            return (String) value;
        } else if (value instanceof Boolean) {
            return (Boolean) value ? "1" : "0";
        } else if (value instanceof Integer) {
            Integer result = (Integer) value;
            return result.toString();
        }
    } else if (type == Type.Bigint) {
        if (value instanceof String) {
            return (String) value;
        } else if (value instanceof Double) {
            Double result = (Double) value;
            return integerFormatter.format(result.doubleValue());
        } else if (value instanceof Long) {
            Long result = (Long) value;
            return result.toString();
        }
    } else if ((type == Type.Varchar30) || (type == Type.Varchar255) || (type == Type.Varchar60) || typeName.startsWith("VARCHAR(")) {
        if (value instanceof String) {
            return embedQuotes((String) value);
        }
    } else if (type == Type.Timestamp) {
        if (value instanceof String) {
            Timestamp ts = Timestamp.valueOf((String) value);
            switch(dialect.getDatabaseProduct()) {
                case ORACLE:
                case LUCIDDB:
                    return "TIMESTAMP '" + ts + "'";
                default:
                    return "'" + ts + "'";
            }
        } else if (value instanceof Timestamp) {
            Timestamp ts = (Timestamp) value;
            switch(dialect.getDatabaseProduct()) {
                case ORACLE:
                case LUCIDDB:
                    return "TIMESTAMP '" + ts + "'";
                default:
                    return "'" + ts + "'";
            }
        }
    } else if (type == Type.Date) {
        if (value instanceof String) {
            Date dt = Date.valueOf((String) value);
            switch(dialect.getDatabaseProduct()) {
                case ORACLE:
                case LUCIDDB:
                    return "DATE '" + dateFormatter.format(dt) + "'";
                default:
                    return "'" + dateFormatter.format(dt) + "'";
            }
        } else if (value instanceof Date) {
            Date dt = (Date) value;
            switch(dialect.getDatabaseProduct()) {
                case ORACLE:
                case LUCIDDB:
                    return "DATE '" + dateFormatter.format(dt) + "'";
                default:
                    return "'" + dateFormatter.format(dt) + "'";
            }
        }
    } else if (type == Type.Real) {
        if (value instanceof String) {
            return (String) value;
        } else if (value instanceof Float) {
            Float result = (Float) value;
            return result.toString();
        }
    } else if ((type == Type.Decimal) || typeName.startsWith("DECIMAL(")) {
        if (value instanceof String) {
            return (String) value;
        } else {
            Matcher matcher = decimalDataTypeRegex.matcher(typeName);
            if (!matcher.matches()) {
                throw new RuntimeException("Bad DECIMAL column type for " + typeName);
            }
            DecimalFormat formatter = new DecimalFormat(decimalFormat(matcher.group(1), matcher.group(2)));
            if (value instanceof Double) {
                Double result = (Double) value;
                return formatter.format(result.doubleValue());
            } else if (value instanceof BigDecimal) {
                BigDecimal result = (BigDecimal) value;
                return formatter.format(result);
            }
        }
    } else if (type == Type.Boolean) {
        if (value instanceof String) {
            String trimmedValue = ((String) value).trim();
            switch(dialect.getDatabaseProduct()) {
                case MARIADB:
                case MYSQL:
                case ORACLE:
                case DB2:
                case DB2_AS400:
                case DB2_OLD_AS400:
                case FIREBIRD:
                case MSSQL:
                case DERBY:
                case INGRES:
                    if (trimmedValue.equals("true")) {
                        return "1";
                    } else if (trimmedValue.equals("false")) {
                        return "0";
                    } else if (trimmedValue.equals("1")) {
                        return "1";
                    } else if (trimmedValue.equals("0")) {
                        return "0";
                    }
                default:
                    if (trimmedValue.equals("1")) {
                        return "true";
                    } else if (trimmedValue.equals("0")) {
                        return "false";
                    }
            }
        } else if (value instanceof Boolean) {
            Boolean result = (Boolean) value;
            return result.toString();
        }
    }
    throw new RuntimeException("Unknown column type: " + typeName + " for column: " + column.getName());
}

