void addFrom(SqlQuery sqlQuery,String alias,boolean failIfExists,boolean addFrom,MondrianDef.RelationOrJoin relation,String alias,boolean failIfExists){
    registerRootRelation(relation);
    if (relation instanceof MondrianDef.Relation) {
        MondrianDef.Relation relation1 = (MondrianDef.Relation) relation;
        if (relations.add(relation1) && !MondrianProperties.instance().FilterChildlessSnowflakeMembers.get()) {
            MondrianDef.RelationOrJoin root = mapRelationToRoot.get(relation1);
            List<MondrianDef.Relation> relationsCopy = new ArrayList<MondrianDef.Relation>(relations);
            for (MondrianDef.Relation relation2 : relationsCopy) {
                if (relation2 != relation1 && mapRelationToRoot.get(relation2) == root) {
                    addJoinBetween(root, relation1, relation2);
                }
            }
        }
    }
    if (relation instanceof MondrianDef.View) {
        final MondrianDef.View view = (MondrianDef.View) relation;
        final String viewAlias = (alias == null) ? view.getAlias() : alias;
        final String sqlString = view.getCodeSet().chooseQuery(dialect);
        return addFromQuery(sqlString, viewAlias, false);
    } else if (relation instanceof MondrianDef.InlineTable) {
        final MondrianDef.Relation relation1 = RolapUtil.convertInlineTableToRelation((MondrianDef.InlineTable) relation, dialect);
        return addFrom(relation1, alias, failIfExists);
    } else if (relation instanceof MondrianDef.Table) {
        final MondrianDef.Table table = (MondrianDef.Table) relation;
        final String tableAlias = (alias == null) ? table.getAlias() : alias;
        return addFromTable(table.schema, table.name, tableAlias, table.getFilter(), table.getHintMap(), failIfExists);
    } else if (relation instanceof MondrianDef.Join) {
        final MondrianDef.Join join = (MondrianDef.Join) relation;
        return addJoin(join.left, join.getLeftAlias(), join.leftKey, join.right, join.getRightAlias(), join.rightKey, failIfExists);
    } else {
        throw Util.newInternal("bad relation type " + relation);
    }
}

