    }
    byte[][] intervals = new byte[splitted.length / 3][3];
    for (int i = 0; i < intervals.length; i++) {
        intervals[i][0] = Byte.parseByte(splitted[i * 3]);
        intervals[i][1] = Byte.parseByte(splitted[i * 3 + 1]);
