T add(T key){
    int i = indexOfInsertion(key);
    if (i < 0) {
        i = -i - 1;
        return this.values[i];
    }
    if (this.distinct > this.highWaterMark) {
        int newCapacity = chooseGrowCapacity(this.distinct + 1, this.minLoadFactor, this.maxLoadFactor);
        rehash(newCapacity);
        return add(key);
    }
    T v = this.values[i];
    this.values[i] = key;
    if (v == null) {
        this.freeEntries--;
    }
    this.distinct++;
    if (this.freeEntries < 1) {
        int newCapacity = chooseGrowCapacity(this.distinct + 1, this.minLoadFactor, this.maxLoadFactor);
        rehash(newCapacity);
    }
    return key;
}

