MessagePacker packInt(int r){
    if (r < -(1 << 5)) {
        if (r < -(1 << 15)) {
            writeByteAndInt(INT32, r);
        } else if (r < -(1 << 7)) {
            writeByteAndShort(INT16, (short) r);
        } else {
            writeByteAndByte(INT8, (byte) r);
        }
    } else if (r < (1 << 7)) {
        writeByte((byte) r);
    } else {
        if (r < (1 << 8)) {
            writeByteAndByte(UINT8, (byte) r);
        } else if (r < (1 << 16)) {
            writeByteAndShort(UINT16, (short) r);
        } else {
            writeByteAndInt(UINT32, r);
