Result shepherdExecution(Execution execution,Callable<Result> callable){
    FutureTask<Result> task = new FutureTask<Result>(callable);
    final Pair<FutureTask<Result>, Execution> pair = new Pair<FutureTask<Result>, Execution>(task, execution);
    tasks.add(pair);
    try {
        executor.execute(task);
        return task.get();
    } catch (Throwable e) {
        execution.cancelSqlStatements();
        if (e instanceof InterruptedException) {
            Thread.currentThread().interrupt();
        }
        Throwable node = e;
        if (e instanceof ExecutionException) {
            ExecutionException executionException = (ExecutionException) e;
            node = executionException.getCause();
        }
        execution.checkCancelOrTimeout();
        final ResourceLimitExceededException t = Util.getMatchingCause(node, ResourceLimitExceededException.class);
        if (t != null) {
            throw t;
        }
        final MondrianException m = Util.getMatchingCause(node, MondrianException.class);
        if (m != null) {
            throw m;
        }
        if (node instanceof RuntimeException) {
            throw (RuntimeException) node;
        } else if (node instanceof Error) {
            throw (Error) node;
        } else {
            throw new MondrianException(node);
        }
    }
}

