CrossJoinArg[] checkFilterPredicate(RolapEvaluator evaluator,ResolvedFunCall predicateCall,boolean exclude){
    CrossJoinArg[] predicateCJArgs = null;
    if (predicateCall.getFunName().equals("()")) {
        Exp actualPredicateCall = predicateCall.getArg(0);
        if (actualPredicateCall instanceof ResolvedFunCall) {
            return checkFilterPredicate(evaluator, (ResolvedFunCall) actualPredicateCall, exclude);
        } else {
            return null;
        }
    }
    if (predicateCall.getFunName().equals("NOT") && predicateCall.getArg(0) instanceof ResolvedFunCall) {
        predicateCall = (ResolvedFunCall) predicateCall.getArg(0);
        exclude = !exclude;
        return checkFilterPredicate(evaluator, predicateCall, exclude);
    }
    if (predicateCall.getFunName().equals("AND")) {
        Exp andArg0 = predicateCall.getArg(0);
        Exp andArg1 = predicateCall.getArg(1);
        if (andArg0 instanceof ResolvedFunCall && andArg1 instanceof ResolvedFunCall) {
            CrossJoinArg[] andCJArgs0;
            CrossJoinArg[] andCJArgs1;
            andCJArgs0 = checkFilterPredicate(evaluator, (ResolvedFunCall) andArg0, exclude);
            if (andCJArgs0 != null) {
                andCJArgs1 = checkFilterPredicate(evaluator, (ResolvedFunCall) andArg1, exclude);
                if (andCJArgs1 != null) {
                    predicateCJArgs = Util.appendArrays(andCJArgs0, andCJArgs1);
                }
            }
        }
        return predicateCJArgs;
    }
    predicateCJArgs = checkFilterPredicateInIs(evaluator, predicateCall, exclude);
    return predicateCJArgs;
}

