String createInsertStatement(ResultSet rs,String name,Column[] columns){
    StringBuilder buf = new StringBuilder();
    buf.append("INSERT INTO ").append(quoteId(schema, name)).append(" (");
    for (int i = 0; i < columns.length; i++) {
        Column column = columns[i];
        if (i > 0) {
            buf.append(",");
        }
        buf.append(quoteId(column.name));
    }
    buf.append(") VALUES(");
    for (int i = 0; i < columns.length; i++) {
        Column column = columns[i];
        if (i > 0) {
            buf.append(",");
        }
        buf.append(columnValue(rs, column));
    }
    buf.append(")");
    return buf.toString();
}

