int loadTable(String name,Column[] columns,long pauseMillis,int batchSize){
    int rowsAdded = 0;
    StringBuilder buf = new StringBuilder();
    buf.append("select ");
    for (int i = 0; i < columns.length; i++) {
        Column column = columns[i];
        if (i > 0) {
            buf.append(",");
        }
        buf.append(quoteId(dialect, column.name));
    }
    buf.append(" from ").append(quoteId(dialect, inputSchema, name));
    String ddl = buf.toString();
    Statement statement = null;
    ResultSet rs = null;
    try {
        statement = inputConnection.createStatement();
        LOGGER.debug("Input table SQL: " + ddl);
        rs = statement.executeQuery(ddl);
        List<String> batch = new ArrayList<String>(batchSize);
        boolean displayedInsert = false;
        while (rs.next()) {
            String insertStatement = createInsertStatement(rs, name, columns);
            if (!displayedInsert && LOGGER.isDebugEnabled()) {
                LOGGER.debug("Example Insert statement: " + insertStatement);
                displayedInsert = true;
            }
            batch.add(insertStatement);
            if (batch.size() >= batchSize) {
                final int rowCount = writeBatch(batch, pauseMillis);
                rowsAdded += rowCount;
                batch.clear();
                if (pauseMillis > 0) {
                    final long t = System.currentTimeMillis();
                    if (t - lastUpdate > 10000) {
                        lastUpdate = t;
                        LOGGER.debug(name + ": wrote row #" + rowsAdded + ".");
                    }
                    Thread.sleep(pauseMillis);
                }
            }
        }
        if (batch.size() > 0) {
            rowsAdded += writeBatch(batch, pauseMillis);
        }
    } finally {
        if (rs != null) {
            try {
                rs.close();
            } catch (SQLException e) {
            }
        }
        if (statement != null) {
            try {
                statement.close();
            } catch (SQLException e) {
            }
        }
    }
    return rowsAdded;
}

