boolean addFromQuery(String query,String alias,boolean failIfExists){
    assert alias != null;
    assert alias.length() > 0;
    if (fromAliases.contains(alias)) {
        if (failIfExists) {
            throw Util.newInternal("query already contains alias '" + alias + "'");
        } else {
            return false;
        }
    }
    buf.setLength(0);
    buf.append('(');
    buf.append(query);
    buf.append(')');
    if (dialect.allowsAs()) {
        buf.append(" as ");
    } else {
        buf.append(' ');
    }
    dialect.quoteIdentifier(alias, buf);
    fromAliases.add(alias);
    from.add(buf.toString());
    return true;
}

