DialectFactory createFactoryForDialect(Class<? extends Dialect> dialectClass){
    for (Field field : dialectClass.getFields()) {
        if (Modifier.isPublic(field.getModifiers()) && Modifier.isStatic(field.getModifiers()) && field.getName().equals("FACTORY") && DialectFactory.class.isAssignableFrom(field.getType())) {
            try {
                final DialectFactory factory = (DialectFactory) field.get(null);
                if (factory != null) {
                    return factory;
                }
            } catch (IllegalAccessException e) {
                throw Util.newError(e, "Error while accessing field " + field);
            }
        }
    }
    try {
        final Constructor<? extends Dialect> constructor = dialectClass.getConstructor(Connection.class);
        if (Modifier.isPublic(constructor.getModifiers())) {
            return new ConstructorDialectFactory(constructor);
        }
    } catch (NoSuchMethodException e) {
    }
    return null;
}

