List<Throwable> runTest(int numThreads,int runTimeInSeconds,boolean randomQueries,boolean printReport,FoodMartTestCase.QueryAndResult[] queriesAndResults,List<Throwable> runTest,int numThreads,int runTimeInSeconds,boolean randomQueries,boolean randomCacheFlush,boolean printReport,FoodMartTestCase.QueryAndResult[] queriesAndResults){
    ConcurrentValidatingQueryRunner[] runners = new ConcurrentValidatingQueryRunner[numThreads];
    List<Throwable> allExceptions = new ArrayList<Throwable>();
    for (int idx = 0; idx < runners.length; idx++) {
        runners[idx] = new ConcurrentValidatingQueryRunner(runTimeInSeconds, randomQueries, randomCacheFlush, queriesAndResults);
    }
    for (int idx = 0; idx < runners.length; idx++) {
        runners[idx].start();
    }
    for (int idx = 0; idx < runners.length; idx++) {
        try {
            runners[idx].join();
        } catch (InterruptedException e) {
            e.printStackTrace();
        }
    }
    for (int idx = 0; idx < runners.length; idx++) {
        allExceptions.addAll(runners[idx].mExceptions);
        if (printReport) {
            runners[idx].report(System.out);
        }
    }
    return allExceptions;
}

