void testUnsupportedAllocationPolicyFails(){
    final TestContext testContext = TestContext.instance().withScenario();
    final OlapConnection connection = testContext.getOlap4jConnection();
    final PreparedOlapStatement pstmt = connection.prepareOlapStatement("select {[Measures].[Unit Sales]} on 0,\n" + "{[Product].Children} on 1\n" + "from [Sales]");
    final CellSet cellSet = pstmt.executeQuery();
    final Cell cell = cellSet.getCell(Arrays.asList(0, 1));
    for (AllocationPolicy policy : AllocationPolicy.values()) {
        switch(policy) {
            case EQUAL_ALLOCATION:
            case EQUAL_INCREMENT:
                continue;
        }
        try {
            cell.setValue(123, policy);
            fail("expected error");
        } catch (RuntimeException e) {
            TestContext.checkThrowable(e, "Allocation policy " + policy + " is not supported");
        }
    }
    try {
        cell.setValue(123, null);
        fail("expected error");
    } catch (RuntimeException e) {
        TestContext.checkThrowable(e, "Allocation policy must not be null");
    }
}

